import React, { useState } from "react";
import "./App.css";
import { Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Route path="/" element={<div>메인페이지</div>} />
      <Route path="/products" element={<div>상품리스트</div>} />
      <Route path="/products/1" element={<div>상품1번 페이지</div>} />
    </div>
  );
}

export default App;
